import React from "react"
import TeamChars from "./TeamChars";

function Team( { teamChars } ) {
    console.log(teamChars)

    const teamArray = teamChars.map((char) => {
        return <TeamChars key={char.id} char={char}/>
    })

    return (
        <div>
            <span>Anchor
                {teamArray[2]}
            </span>
            <span>Mid
                {teamArray[1]}
            </span>
            <span>Point
                {teamArray[3]}
            </span>
        </div>
    )
}

export default Team;
